INSERT INTO `products` VALUES (9,1,'Cochecito Cuna Joie Travel ',14000,8000,'2020-06-30',10,15,'S',' Plegado con bloqueo de plegado automático. Adecuada desde el nacimiento gracias a su reclinado total y en 4 posiciones.Una vez plegada se mantiene de pie. Reposapiernas ajustable en 2 posiciones. Gran capota ajustable con visera y ventana. ',' Uso del producto: desde el nacimiento hasta los 17,5 kg'),(11,1,'Butaca Booster Bebe Mega ',7000,5000,'2020-06-30',10,15,'S',' Butaca del grupo 1+2+3.El cinturón de seguridad de 5 puntos otorga tranquilidad extra para los padres su apoyacabeza regulable en altura y respaldo reclinable permiten adaptarse a cada necesidad.Grupo 1+2+3 (9-36 Kg)\\.Cinturón de seguridad  ',' Uso del producto: desde el nacimiento hasta los 17,5 kg'),(12,1,'Butaca Mega Baby Daytona ',7900,5000,'2020-06-30',15,15,'S',' Homologada para Grupo 1/2/3 (de 9 a 36 kg).\\r\\nSistema ISOFIX de 3 anclajes.\\r\\nCumple las normas de seguridad ECE R/44. Incluye cinturón de 5 puntos.\\r\\nPosa cabeza ajustable en alturas.\\r\\nCuenta además con reductores internos que proporcionan un mayor',' Protectores de hombros con antideslizantes.\\r\\nApoya cabeza : Protección lateral.'),(14,5,'Silla Mecedora  Mega Baby ',6000,4000,'2020-06-30',20,5,'S',' Se puede usar desde recién nacido hasta niños pequeños de hasta 20 kilos.\\r\\nCambia de asiento cuna a asiento fijo en un instante.\\r\\nTiene dos posiciones de reclinado del asiento.\\r\\nVibraciones que ayudan a relajar al BEBE.\\r\\nBarra de juguetes para Be','  De fácil limpieza , se puede lavar a maquina lavadora.\\r\\nCuenta con cinturón de seguridad de 3 puntos de sujeción.'),(15,4,'Set 3 Bodys Gamise',600,300,'2020-06-30',15,5,'S','  Set de 3 Bodys\\r\\n100% Algodon\\r\\nTalles de 0 a 6.',' '),(16,3,'Cochecito Duck Legend',9000,7000,'2020-06-30',50,10,'S',' Coche Reclinable múltiples posiciones.Ruedas delanteras fijas o giratoria. Ruedas traseras con frenos sincronizados.Posa pies regulables. Capota Europea.Doble acolchado.Cinturón de seguridad 5 puntos.Canasto porta-paquetes.Barral desmontable.Plegable.Por',' '),(17,5,'Bañera Plegable',5000,3000,'2020-06-30',30,20,'S',' Bañera Plegable\\r\\n*Compartimiento para dejar los accesorios del baño.\\r\\n*Gancho para colgarla en la pared\\r\\n*Plegado extra plano para transportar y guardar fácilmente.\\r\\n*Sistema de plegado tipo acordeón.\\r\\n*Material suave al taco para mayor confort',' '),(18,6,'Practicuna Cuna Megababy ',15000,7000,'2020-06-30',5,40,'S',' La practicuna incluye en uno de los cabezales un organizador con tres compartimientos para tener todo organizado y al alcance de la mano para poder cambiar al bebe. Además para mayor comodidad de la madre la practicuna cuenta con un cambiador removible d',' '),(19,5,'Catre con Bañera',5000,3000,'2020-07-02',10,5,'S',' Catre De Baño Para Bebé Branda Due 404 Infanti Creciendo.Hasta 26 Litros.Material Aluminio, ',' '),(20,3,'Duck Legends',4000,2000,'2020-07-02',15,10,'S',' lalalalal',' ');
